// Function for drawing Lake Oswego, OR elevation data via ScriptCraft for
// Minecraft.
// See this post for more information:
//   http://rogerallen.github.io/minecraft/2014/05/09/scriptcraft-for-creating-topography-in-minecraft/
// May, 2014
var lakeo = function() {
    // saves the drone position so it can return there later
    this.chkpt('lakeo');
    var x, y;
    var w = 3;
    for(y = 0; y < 140; y++ ) {
        for(x = 0; x < 200; x++) {
            var h = lakeo_elevation[y][x];
            var b = lakeo_blocks[y][x];
            if(b === 0) {
                // water
                var h2 = w*4;
                var h1 = h - h2;
                if(h1 > 0) {
                    this.box(blocks.clay,w,h1,w)
                        .up(h1)
                        .box(blocks.water,w,h2,w)
                        .down(h1);
                } else {
                    this.box(blocks.water,w,h,w)
                }
            } else if(b === 1) {
                // grass-covered block
                var h2 = w;
                var h1 = h - h2;
                if(h1 > 0) {
                    this.box(blocks.dirt,w,h1,w)
                        .up(h1)
                        .box(blocks.grass,w,h2,w)
                        .down(h1);
                } else {
                    this.box(blocks.grass,w,h,w)
                }
            } else if(b === 2) {
                // high grass-covered block
                var h3 = w;
                var h2 = w*3;
                var h1 = h - h2 - h3;
                if(h1 > 0) {
                    this.box(blocks.stone,w,h1,w)
                        .up(h1)
                        .box(blocks.dirt,w,h2,w)
                        .up(h2)
                        .box(blocks.grass,w,h3,w)
                        .down(h1+h2);
                } else {
                    this.box(blocks.grass,w,h,w)
                }
            }
            this.right(w);
        }
        this.left(x*w).fwd(w);
    }
    // return to where we started
    return this.move('lakeo');
};
// Okay this extends the drone object to include this fn
var Drone = require('../drone/drone').Drone;
Drone.extend('lakeo',lakeo);

